import React from "react";

import backwards from "../sections/backwards.js";

export const About = () => {
  return (
    <div id="about">
      <backwards />

      <div class="about-content">
        <div class="about-title">
          <h1>About</h1>
        </div>

        <div class="about-text">
          <p>
            This website was made with the purpouse of being the project for my
            final year of highschool as well as a project for my portfolio as a
            programmer.
            <br></br>The website will be updated over time as new features are
            added.
            <br></br>Suggestions regarding updates and any bugs found are always
            welcome.
          </p>
        </div>
      </div>
    </div>
  );
};

export default About;
